import React from 'react';
import { Paper, Typography, Box, List, ListItem, ListItemText } from '@mui/material';

const About: React.FC = () => {
  return (
    <Box sx={{ 
      minHeight: '100vh', 
      background: 'linear-gradient(135deg, #b2ebf2 0%, #80deea 50%, #4dd0e1 100%)', 
      px: 2, 
      display: 'flex', 
      flexDirection: 'column', 
      alignItems: 'center', 
      pb: { xs: 7, md: 8 } 
    }}>
      <Paper 
        elevation={6} 
        sx={{ 
          maxWidth: 1200, 
          width: '100%', 
          borderRadius: 4, 
          overflow: 'hidden', 
          mt: { xs: 2.625, md: 4.625 },
          background: 'linear-gradient(135deg, rgba(255,255,255,0.95) 0%, rgba(255,255,255,0.9) 100%)',
          backdropFilter: 'blur(10px)',
          border: '1px solid rgba(255, 255, 255, 0.2)',
          boxShadow: '0 20px 40px rgba(0, 0, 0, 0.1)',
          transition: 'transform 0.3s ease',
          '&:hover': {
            transform: 'translateY(-5px)',
          }
        }}
      >
        <Box sx={{ 
          display: 'flex', 
          flexDirection: { xs: 'column', md: 'row' },
          minHeight: '600px' 
        }}>
          {/* Sol Kolon - Ana Başlık */}
          <Box sx={{ 
            flex: 1,
            background: 'linear-gradient(135deg, #00b894 0%, #00cec9 100%)', 
            color: '#fff', 
            p: { xs: 4, md: 6 }, 
            display: 'flex', 
            flexDirection: 'column', 
            justifyContent: 'center', 
            position: 'relative',
            overflow: 'hidden',
          }}>
            <Box sx={{ position: 'relative', zIndex: 1 }}>
              <Typography 
                variant="h3" 
                fontWeight={700} 
                mb={3}
                sx={{
                  textShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
                  fontSize: { xs: '1.8rem', md: '2.5rem' }
                }}
              >
                İngilizce Hazırlık Platformu
              </Typography>
              <Typography 
                variant="h5" 
                fontWeight={700} 
                mb={3} 
                sx={{ 
                  color: 'rgba(255, 255, 255, 0.95)',
                  textShadow: '0 2px 4px rgba(0, 0, 0, 0.2)',
                  fontSize: { xs: '1.2rem', md: '1.5rem' }
                }}
              >
                Hazırlan. Çalış. Başar.
              </Typography>
              <Typography 
                variant="body1" 
                mb={4} 
                sx={{ 
                  color: 'rgba(255, 255, 255, 0.9)',
                  fontSize: '1.1rem',
                  lineHeight: 1.6,
                  textShadow: '0 1px 2px rgba(0, 0, 0, 0.1)'
                }}
              >
                Erasmus'a ve İngilizce sınavlarına hazırlanmanın en gerçekçi ve eğlenceli yolu!
              </Typography>
            </Box>
          </Box>

          {/* Orta Kolon - İstatistikler */}
          <Box sx={{ 
            flex: 1,
            background: 'linear-gradient(135deg, rgba(255,255,255,0.9) 0%, rgba(255,255,255,0.8) 100%)',
            backdropFilter: 'blur(5px)',
            color: '#2c3e50', 
            p: { xs: 4, md: 6 }, 
            display: 'flex', 
            flexDirection: 'column', 
            justifyContent: 'center',
          }}>
            <Typography 
              variant="h5" 
              fontWeight={700} 
              mb={4} 
              sx={{
                background: 'linear-gradient(135deg, #00b894 0%, #00cec9 100%)',
                backgroundClip: 'text',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent',
                textAlign: 'center'
              }}
            >
              Platform Özellikleri
            </Typography>

            <Box sx={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: 3 }}>
              <Box sx={{ 
                textAlign: 'center',
                p: 2,
                background: 'rgba(0, 184, 148, 0.1)',
                borderRadius: 3,
                border: '1px solid rgba(0, 184, 148, 0.2)',
              }}>
                <Typography variant="h3" fontWeight={700} sx={{ color: '#00b894' }}>500+</Typography>
                <Typography variant="body1" sx={{ color: '#2c3e50', fontWeight: 600 }}>Aktif Kullanıcı</Typography>
              </Box>
              <Box sx={{ 
                textAlign: 'center',
                p: 2,
                background: 'rgba(0, 184, 148, 0.1)',
                borderRadius: 3,
                border: '1px solid rgba(0, 184, 148, 0.2)',
              }}>
                <Typography variant="h3" fontWeight={700} sx={{ color: '#00b894' }}>1000+</Typography>
                <Typography variant="body1" sx={{ color: '#2c3e50', fontWeight: 600 }}>Soru Bankası</Typography>
              </Box>
            </Box>
          </Box>

          {/* Sağ Kolon - Teknolojiler */}
          <Box sx={{ 
            flex: 1,
            background: 'linear-gradient(135deg, rgba(255,255,255,0.95) 0%, rgba(255,255,255,0.85) 100%)',
            backdropFilter: 'blur(5px)',
            color: '#2c3e50', 
            p: { xs: 4, md: 6 }, 
            display: 'flex', 
            flexDirection: 'column', 
            justifyContent: 'center'
          }}>
            <Typography 
              variant="h5" 
              fontWeight={700} 
              mb={4} 
              sx={{
                background: 'linear-gradient(135deg, #00b894 0%, #00cec9 100%)',
                backgroundClip: 'text',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent',
                textAlign: 'center'
              }}
            >
              Teknolojiler
            </Typography>

            <Box sx={{ display: 'grid', gridTemplateColumns: 'repeat(2, 1fr)', gap: 2 }}>
              <Box sx={{ textAlign: 'center', p: 2 }}>
                <Typography fontSize={14} fontWeight={600} sx={{ color: '#2c3e50' }}>React</Typography>
              </Box>
              <Box sx={{ textAlign: 'center', p: 2 }}>
                <Typography fontSize={14} fontWeight={600} sx={{ color: '#2c3e50' }}>TypeScript</Typography>
              </Box>
              <Box sx={{ textAlign: 'center', p: 2 }}>
                <Typography fontSize={14} fontWeight={600} sx={{ color: '#2c3e50' }}>Node.js</Typography>
              </Box>
              <Box sx={{ textAlign: 'center', p: 2 }}>
                <Typography fontSize={14} fontWeight={600} sx={{ color: '#2c3e50' }}>MySQL</Typography>
              </Box>
            </Box>
          </Box>
        </Box>
      </Paper>
    </Box>
  );
};

export default About;
